import React from "react";

import {productCards} from "../../utils/Constant";
import Card1 from "./Card1";






const Card = () => {
  return (
    <div className="card h-auto w-auto rounded-md inline-flex flex-col ">
      <div className=" card1 ring-1 bg-[#E26D5A] rounded-xl inline-flex  flex-col ">
        <div className="inline-flex justify-between rounded-full flex-col">
          <div className="inline-flex flex-row justify-between">
            <span>Deal of of The Day</span>
            <button>View All</button>
          </div>
          <div className="card11 rounded-xl ">
            <div className="grid gap-4 grid-cols-3 grid-rows-2 rounded-xl">
              {productCards.map((k ,i)=>{
                  return (
                    <Card1 key={i} src={i.cardImage} text="Tata Steel TMT" />

                  )
              })} 

            </div>
          </div>
        </div>
      </div>
      <div className="inline-flex flex-col h-auto w-auto ">
        <div className=" card2 "></div>
        <div className="card3 "></div>
      </div>
    </div>
  );
};

export default Card;
